import axios from "axios";
import React from "react";

class App extends React.Component{
    constructor(){
        super();
        this.state={
            hasErrors:false,
            planets: {}
        };
    }

    componentDidMount(){
        fetch('https://randomuser.me/api')
           .then( res =>  res.json())
           .then(res => this.setState({planets:res}))
    }

    render(){
        return <h1>{this.state.planets}</h1>
    }
}
export default App;
